const projectDatabase=JSON.parse(localStorage.getItem("projectList")),projectsEl=document.getElementById("projects");for(let e=0;e<projectDatabase.length;e++){let t=projectDatabase[e];projectsEl.innerHTML+=`\n        <article class="project">\n            <h2 class="project-name">${t.name}</h2>\n            <p class="project-date"><b>Date Completed:</b> ${t.date_completed}</p>\n            <p class="project-tech"><b>Technologies Used:</b> ${t.technologies_used}</p>\n            <p class="project-team"><b>Teammates (if applicable):</b> ${t.teammates}</p>\n            <p class="project-description">${t.description}</p>\n        </article>\n        `}